INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (198,'042','백 사람이 함께 농사를 지으니 염해는 언이 상관 합니다. 7년의 가뭄였던 땅이 단비를 만나게 되었으니 이보다 더 기쁜 일이 있겠습니까?. 수명하면 길함이 있으니 반드시 공명을 얻게 되겠습니다. 밖으로 대단한 부자이나 안으로는 그 실상이 적으니 너무 떠벌리지 않도록 주의해야 합니다. 사람들이 있어 많이 도와주니 이익이 그 가운데 생깁니다. 곤하다가도 곧 평안함을 얻게 되니 뜻밖의 재물이 생길 수입니다. 재물이 생기는 도리는 말하는 곳갈과 문서로서 이루어지니 관심을 쓸일 일입니다. 바다에 쉬어있는 용의 뜻을 감히 촉환할 수 있겠습니까? 이달에 봄이 돌아왔으니 만물이 드디어 회생하겠습니다. 바다의 쉬은 용처럼 으두를 터야 합니다.','이익은 어디에 있는가 하면 옛부터 사귀어왔던 친한 사람에게 있습니다. 또한 우연히 도와주거나 그런 사람이 나타날 것이니 뜻밖의 재물을 얻게 되겠습니다. 봄바람이 따뜻하게 부는데 어찌 만물이 다시 회생하지 않겠습니까. 드디어 때가 왔습니다.','비록 재수는 좋으나 손실도 또한 그를 따르니 조심해야 합니다. 명월에는 길함이 있어 남들로부터 칭송을 받으나 그만큼 재물이 생기는 것이 아닙니다. 어차피 손재할 염려가 있으니 이익을 취하고자 할 때 신축을 기하지 않으면 안됩니다.','가만히 있어 하던 일을 지키면 길하고 움직여서 다른 것을 꾀하면 불리합니다. 이 달의 운수는 구설수를 조심해야 합니다. 봄에는 길흉이 상반하니 일마다 반드시 성사를 하는 것이 아닙니다. 그러나 뜻한 바가 쉽게 풀리니 진행함이 좋겠습니다.','복숭아와 오얏나무가 봄철을 만나니 힘이 떨어지고 역경을 몰을 짐작입니다. 만약 관력이 아니라면 필시 자신으로 인한 경사입니다. 이 달의 운수는 반드시 경사가 있으니 미리 대비하여 더욱더 즐겁도록 해야 합니다.','밖에서 재물을 구하거나 남의 것을 탐하지 마십시오. 구설이 분분해지겠습니다. 5월과 6월에는 얻으려고 꾀하려다가 어차피 잃게 될 것이니 과욕을 부려서는 안됩니다. 두 마음이 하나같지 않고 서로 대립되니 이를 이루기는 매우 힘듭니다.','신수가 평탄하고 길하나 재수는 완전하지 않으니 재물을 꾀하는데 주의하십시오. 분수 밖의 것을 탐하게 되면 손재수가 기다리고 있으니 먼저 지키는 것을 생각하십시오. 만약에 관력을 받거나 그런 기회가 생기지 않는다면 도리어 시비할까 두렵습니다.','다행하게도 귀인을 만나게 되며 뜻밖의 후의수도 있습니다. 7월과 8월에는 굶주린 자가 밥을 얻어먹는 것이니 후사를 면하게 되겠습니다. 구름 밖 만리에 반드시 경사가 있으므로 어떤 어려움도 참고 견디면 좋은 운을 만나게 됩니다.','봄 동산에 꽃봉에 바쁘가 몰려와 엄습니다니 기쁨이 충실합니다. 먼 곳에서 기쁜 편지가 왔으니 반드시 정다운 법을 맺이할 짐작입니다. 여러 사람이 서로 도와주니 재수가 살아납니다. 좋은 법이 생기고 재수가 좋은데 무엇을 더 바라겠습니다.','길성이 몸을 붙이고 있으니 이름이 사방으로 떨치게 되겠습니다. 이 달의 운수는 가을의 국화가 하루아침에 꽃을 피우게 된 것이니 맹사 성취됨이 신속하겠습니다. 글쓴이내로 뜻밖의 많은 것들이 생겨나서 도움을 주게 됩니다.','가을 밤 창경에 외롭게 웠던 기러기가 어디로가 날아갑니다. 만약에 부모의 근심이 없다면 자손에게 얼이 있을 것이니 한 번은 크게 무로움을 겪겠습니다. 이 달의 운수는 적게 얻고 도리어 많이 나가니 신수가 공고함을 어찌 면할 수 있겠습니까?','작은 것을 구하려고 했는데 어차피 큰 것을 얻게 되었으니 모든 일이 잘 풀리게 됩니다. 한 집안이 넉넉하게 되었으니 집안 사람들이 화평하고 즐겁겠습니다. 기쁜 일이 즘진한데 어찌 심신이 화평하지 않겠습니까. 힘써 이를 도모할 운수입니다.','사람 사귀기를 소홀하게 하면 사귄 사람으로 인해 후사를 당하게 됩니다. 주어진 땅에 머물러 있으면 불리하고 하던 이익만을 바라고 있는 것도 불리합니다. 그렇다고 분수 밖의 것을 탐하게 되면 크게 실패할 수 있습니다. 비록 가진 것이 불리해도 지키만 못하겠습니다.','2025-03-02 11:57:24.642627+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (411,'042','当一百人一起耕种时，大海理解。有比七年干旱遇见丹比的土地更快乐的事情吗？如果您的寿命长，您将能够产生共鸣。有一个有钱人或里面的小男人，所以请注意不要太多。有人，所以它有很大帮助，因此利润会出现。即使很难获得和平，也可能导致意外的财富。多里（Dori）发生了财富，是作为描述和文档做出的。你敢看到海中的龙遗嘱吗？春天已经回来了，因此所有事物最终都会再生。它一定像剩下的大海一样像休息一样。','从远古时代约会的亲密人物在哪里。此外，我们将帮助您或出现这样的人，因此我们将获得意外的财富。春天的微风吹动，所有事物将如何再次再生？终于来了。','尽管很幸运，但损失也跟随他，所以要小心。 Myeongwol有很长的路要走，因此受到其他人的称赞，但并不会造成财富。无论如何，您可能会担心它，因此您必须在您想获利时建造新的建筑。','如果您继续做自己在做的事情，那么如果您尝试做其他事情，那将是不利的。这个月的运气必须小心。在春天，吉尔矛盾，因此不一定是这种情况。但是，由于含义很容易解决，因此很容易进行。','当桃子和燕麦树在春天相遇时，它们很强大，可以猜测逆境。如果不是这样，那是由您自己引起的坡度。这个月的运气必须倾斜，因此您应该提前更有趣。','不要在外面找到财富，也不要渴望别人。构造将被分割。在5月和6月，您应该尝试获得它，但无论如何您都应该丢失它。这两个思想不一样，彼此面对，因此很难实现这一目标。','Sinsu既持久又长，但是运气不完整，所以请注意财富。如果您渴望喷泉，您正在等待儿子Jae -Soo，所以请考虑先保留它。如果您没有机会或有这样的机会，我害怕受精。','幸运的是，您会遇到高贵的人，并且有一个意外的数字。在七月和八月，饥饿正在吃米饭，所以我将避免他的继承人。云层外面有一个斜坡，因此，如果您遇到任何困难，您会遇到好运。','我忙于春季花园里的芽，喜悦是忠实的。我有一个遥远地方的好信，所以我必须猜测法律。几个人互相帮助，所以运气栩栩如生。有一个很好的法律和好运，但我希望更多。','Gilseong坚持这个名字，名称将在任何地方显示。这个月的运气是，秋天的菊花在一夜之间开花，因此可以实现。在作者中，创建了许多意外的事情来提供帮助。','在秋天的夜晚，寂寞的鹅飞翔。如果您没有父母的担忧，那么您将有很多不寻常的事情。 Sinsu怎么会变得强大，因为这个月的运气会很大并出去了很多？','我试图得到一个小的，但是无论如何我都得到了一件大事，所以一切都做得很好。家庭将充满和平与愉快。我很高兴，但是我怎么能不安宁？尝试这样做很幸运。','如果您忽略了一个人，那么您将由您拥有的人成功。如果您留在给定的土地上，那么您只想受益也是不利的。但是，如果您渴望从喷泉中脱颖而出，那么您可能会大大失败。即使它不利，我也无法保留它。','2025-03-02 11:57:24.642627+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (482,'042','100人の人々が一緒に農場であるため、海は理解しています。 7歳の干ばつであった土地よりも幸せなことはありますか？あなたが長い寿命を持っているなら、あなたは共鳴することができるでしょう。小さな金持ちがいるか内部がいるので、あまりにもあまりないように注意してください。人々がいるので、それは大いに役立つので、利益が入ります。平和を得るのは難しいとしても、予期せぬ富を引き起こす可能性があります。富が発生するドリは、説明と文書として作られています。海でのドラゴンの意志をあえて見てもらえますか？春が今月戻ってきたので、すべてのものが最終的に再生されます。それは海の残りの残りのような休息のようになければなりません。','古代から付き合ってきた親しい人、利益はどこにありますか。さらに、私たちはあなたを助けたり、そのような人を見せたりするので、予期せぬ富を得るでしょう。春のそよ風は暖かく吹きます、すべてのものはどのように再び再生されますか？ついに来ました。','幸運なことは良いことですが、損失も彼に続きますので、注意してください。 Myeongwolには長い道のりがあるので、他の人に賞賛されていますが、富を引き起こしません。とにかく、あなたはそれを心配しているかもしれないので、あなたは利益を得たいときに新しい建設を構築する必要があります。','自分がしていることをやり続けると、何か他のことをしようとすると不利です。今月の運はガスルに注意しなければなりません。春には、ギルは矛盾しているため、必ずしもそうではありません。ただし、意味が簡単に解決されるため、簡単に進めることができます。','春に桃とエンバクの木が会うとき、それらは強力であり、逆境を促進することを推測します。そうでない場合、それは自分自身によって引き起こされる斜面です。今月の運は傾斜している必要があるので、事前にもっと楽しくする必要があります。','外に富を見つけたり、他の人を切望したりしないでください。建設は分割されます。 5月と6月には、それを手に入れようとする必要がありますが、とにかくそれを失うはずです。二人の心は同じではなく、お互いに立ち向かうので、それを達成することは非常に困難です。','sinsuは平らで長いですが、運は完全ではないので、富に注意してください。あなたが噴水を切望しているなら、あなたは息子のジェを待っているので、それを最初に保つことを考えてください。あなたがチャンスがないか、そのような機会があれば、私は施肥することを恐れています。','幸いなことに、あなたは高貴な人に会い、予期しない数があります。 7月と8月には、おなかがすいたご飯を食べているので、私は彼の相続人を避けます。雲の外に斜面があるので、困難に耐えれば幸運に会います。','私は春の庭の芽に忙しく、喜びは忠実です。私は遠い場所から良い手紙を持っているので、法律を推測しなければなりません。何人かの人がお互いを助けてくれるので、運が命を吹き込みます。良い法律と幸運がありますが、もっと願っています。','Gilseongは名前に固執しており、名前はどこにでも表示されます。今月の幸運は、秋の菊が一晩開花したので、それは満たされることです。作家では、多くの予期せぬことが支援するために作成されています。','秋の夜に孤独だったガチョウは、チャンキョンが飛ぶ。両親の心配がなければ、あなたはたくさんの珍しいことをするでしょう。今月の運が多くのことをしてたくさん出て行くので、どうしてシンズは強くなることができますか？','私は小さなものを手に入れようとしましたが、とにかく大きなものを手に入れたので、すべてがうまくいきました。世帯はたくさんの平和で楽しいものになります。私は幸せですが、どうして私は平和を感じることができませんか？これをしようとするのは幸運です。','人を作ることを怠ると、あなたが持っている人によって成功するでしょう。特定の土地に滞在している場合、利益のみをしたいだけであることも不利です。ただし、噴水から物事を切望している場合は、大いに失敗する可能性があります。たとえそれが不利であっても、私はそれを保つことができません。','2025-03-02 11:57:24.642627+00','j');
